const Container = styled.div`
  max-width: 760px;
  margin: 0 auto;
  text-align: center;
`

const Grid = styled.div`
  margin-top: 64px;
  display: grid;
  grid-template-columns: repeat(3, 1fr);
  grid-gap: 1.5rem;
`

export default function IndexPage() {
  return (
    <Container>
      <GlobalStyle />
      <SearchCountry />
    </Container>
  )
}
